INSERT INTO `faqs` (`id`, `category_id`, `question`, `slug`, `answer`, `status`, `created_at`, `updated_at`) VALUES
(1, 1, 'What is Menorah Exam?', 'what-is-menorah-exam', '<p>Menorah Exam is a professional, internet based Testing Platform, using which you can conduct tests for your aspirants (students or employees). A fast yet easy approach that lets you store your questions and tests on an online testing platform seamlessly. &nbsp;Simple procedure involved in the creation and assignment of tests with the smooth development of reports.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Considering an example: If in case you want to conduct a test for a group with multiple aspirants. Menorah Exam is the right platform where you can create, distribute and generate scores, to the performed tests efficiently.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Hybrid testing algorithm complemented with optimum security offers suitable environment for taking test whenever and wherever you want to. Although it is an online assessment program, but no additional software or plug in &nbsp;are required for you (user) and for your users (students).</p>\r\n', 1, '2019-05-24 08:32:39', '2019-05-27 02:01:22'),
(2, 1, 'How to activate a Free Trial account?', 'how-to-activate-a-free-trial-account-1', '<p>You can activate a Free Trial account from Menorah exam&rsquo;s website.</p>\r\n\r\n<p>Click on Sign up option and enter few basic details for creation of your account. Once created the account, input the required credentials and start a new experience the best Online Exam Software.</p>\r\n', 1, '2019-05-27 02:02:12', '2019-05-27 02:02:12'),
(3, 1, 'How to choose the right subscription plan?', 'how-to-choose-the-right-subscription-plan-2', '<p>Choose your subscription for a particular plan in accordance to your requirements. Think exam offers &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;a trial, starter, standard, professional and business account categories to its users. However, the user can log on to our website or can get in touch with our sales representative to have detailed information about any of the account types.</p>\r\n', 1, '2019-05-27 02:02:43', '2019-05-27 02:02:43'),
(4, 1, 'How to check the test result and review the performance of the associated students?', 'how-to-check-the-test-result-and-review-the-performance-of-the-associated-students-3', '<p>Menorah Exam the online exam software will save the calculated test results, that can swiftly be reviewed and exported for further forefront analysis. From the Report section, the user can easily view and export results seamlessly.</p>\r\n', 1, '2019-05-27 02:03:30', '2019-05-27 02:03:30'),
(5, 1, 'List the most commonly used test settings?', 'list-the-most-commonly-used-test-settings-4', '<p>Menorah Exam is an online testing platform, offers vivid advance test settings options ;</p>\r\n\r\n<ul>\r\n  <li>\r\n  <p>Arrangement and Groupings of Questions and Answers</p>\r\n </li>\r\n <li>\r\n  <p>Subject Wise time settings</p>\r\n </li>\r\n <li>\r\n  <p>Publish Results and Reports, etc.</p>\r\n  </li>\r\n</ul>\r\n', 1, '2019-05-27 02:03:55', '2019-05-27 02:03:55'),
(6, 1, 'What are top ups?', 'what-are-top-ups-5', '<p>Top ups are&nbsp;<strong>add on services</strong>&nbsp;that can be used to avail credit packs of &nbsp;tests, email &amp; SMS matching your requirements valid for a duration of 1 year.are.</p>\r\n', 1, '2019-05-27 02:04:21', '2019-05-27 02:04:21'),
(7, 1, 'What does “Add Student” mean?', 'what-does-add-student-mean-6', '<p>The user, i.e. the administrator can also associate students with his account. The admin can add sequential set of students by providing few initial entities for each of the students. However, can add multiple students using an import of excel file.</p>\r\n', 1, '2019-05-27 02:05:01', '2019-05-27 02:05:01'),
(8, 3, 'Is it possible to club a test series (product) and directly associate the created product to a group of aspirants (students)?', 'is-it-possible-to-club-a-test-series-product-and-directly-associate-the-created-product-to-a-group-of-aspirants-students-7', '<p>Yes, the user can create a Product with multiple tests on this online assessment software. A Product can easily be assigned to a group of applicants.</p>\r\n\r\n<p>Refer the below mentioned steps to associate a created Product with the aspirants;</p>\r\n\r\n<ol>\r\n  <li>Choose tests and add to a Product</li>\r\n  <li>Assign the Product to a group or batch of students</li>\r\n <li>Publish the Product</li>\r\n</ol>\r\n', 1, '2019-05-27 02:06:25', '2019-05-27 02:06:25'),
(9, 3, 'Is there any limit to add the number of users in a system?', 'is-there-any-limit-to-add-the-number-of-users-in-a-system-8', '<p>You can add and manage multiple users to your panel. This will help to conduct tests among multiple students depending upon the test attempt limit. The limit to test attempts, will be in accordance with the subscription purchased that can be increased anytime as per the requirements.</p>\r\n', 1, '2019-05-27 02:06:58', '2019-05-27 02:06:58'),
(10, 3, 'Can I create an extra administrator?', 'can-i-create-an-extra-administrator-9', '<p>The limit to define administrator will be proportionate to the type of account purchased on the online exam software. A trial and a starter account offers &nbsp;the authority to add 1 admin and for a standard, professional and business account, you can add 2, 3 and 5 admin&rsquo;s respectively.</p>\r\n\r\n<p>The primary administrator can specify the rights and permission to the secondary administrators.&nbsp;Permissions will include the viewing rights, marking schemes and deleting authorizations; Managing Tests and Questions; Managing Users and Assign Tests to be taken and more.</p>\r\n', 1, '2019-05-27 02:07:29', '2019-05-27 02:07:29'),
(11, 3, 'Will I remain the owner of my content that I have uploaded on Menorah Exam?', 'will-i-remain-the-owner-of-my-content-that-i-have-uploaded-on-menorah-exam-10', '<p>Yes, you will be the owner of the content that you have uploaded to the portal.</p>\r\n\r\n<p>However, Menorah Exam will not take any ownership/ proprietary rights of the content created or uploaded by its users. You can check the initial Terms and Conditions.</p>\r\n', 1, '2019-05-27 02:08:18', '2019-05-27 02:08:18'),
(12, 3, 'Am I allowed to remove the name “Menorah Exam” from the panel?', 'am-i-allowed-to-remove-the-name-menorah-exam-from-the-panel-11', '<p>Menorah Exam offers the provision to full white labeling in the Test Taker Panel, using the Professional or Business subscriptions. White labeling provides you the access to remove the name, logo, etc. from the test taker panel. Furthermore, you can directly get in touch with our&nbsp;support team to use your URL in the Test Taker Panel via sub-domain masking.</p>\r\n', 1, '2019-05-27 02:09:00', '2019-05-27 02:09:00'),
(13, 3, 'How to terminate a subscribed plan?', 'how-to-terminate-a-subscribed-plan-12', '<p>Once you have subscribed to a particular plan, it cannot be terminated. Moreover, if in case you want to upgrade, you can easily upgrade your account in the sequential account type listed as a trial, starter, standard, professional and business.</p>\r\n', 1, '2019-05-27 02:09:38', '2019-05-27 02:09:38'),
(14, 2, 'What are the steps involved in changing the user account (administrator) password?', 'what-are-the-steps-involved-in-changing-the-user-account-administrator-password-13', '<p>The user account password will be changed by following the below mentioned steps;</p>\r\n\r\n<p><br />\r\nGo to Settings &gt;&gt; User &gt;&gt; Select Admin &gt;&gt; Click on Edit &gt;&gt; Edit User &gt;&gt; Change the password &gt;&gt; Save</p>\r\n', 1, '2019-05-27 02:10:12', '2019-05-27 02:10:12'),
(15, 2, 'How Menorah exam will ensures cheat protection?', 'how-menorah-exam-will-ensures-cheat-protection-14', '<p>Menorah Exam constitutes of special Anti-Cheat features that can be used to avoid cheating in the test paper, for eg:</p>\r\n\r\n<ol>\r\n <li><em>Grouping</em>\r\n\r\n <ul>\r\n    <li><em>a. Shuffle Questions within Subject</em></li>\r\n </ul>\r\n </li>\r\n <li><em>Shuffling</em>\r\n  <ul>\r\n    <li><em>a. Option wise Shuffling Test Options</em></li>\r\n   <li><em>b. Mandatory to attempt all the questions</em></li>\r\n   <li><em>c. Allow user to move back and forward</em></li>\r\n  </ul>\r\n </li>\r\n <li><em>Time Settings</em>\r\n  <ul>\r\n    <li><em>a. Section wise time</em></li>\r\n    <li><em>b. Automize time for all questions in a test</em></li>\r\n  </ul>\r\n </li>\r\n</ol>\r\n', 1, '2019-05-27 02:10:53', '2019-05-27 02:10:53'),
(16, 2, 'Will my data on Menorah Exam kept private?', 'will-my-data-on-menorah-exam-kept-private-15', '<p>Yes, the uploaded data on Menorah Exam will be secured. The data stored in terms of credentials, tests, products, etc. will be restricted and secured to any external threat. All the data is stored in Encrypted form.</p>\r\n', 1, '2019-05-27 02:11:29', '2019-05-27 02:11:29'),
(17, 2, 'Can I remove my uploaded content from the panel?', 'can-i-remove-my-uploaded-content-from-the-panel-16', '<p>Yes, you can easily remove the uploaded content from the panel. This includes the textual matter like subjects, topics, questions, tests , packages, etc. on Think Exam at any point of time.</p>\r\n', 1, '2019-05-27 02:11:56', '2019-05-27 02:11:56'),
(18, 4, 'Do I need to install any additional software?', 'do-i-need-to-install-any-additional-software-17', '<p>No. Menorah Exam the Online Assessment Software does not require any additional software installation.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Tests can be Created and Taken using standard devices that are listed below:</p>\r\n\r\n<p>* Computer web browsers</p>\r\n\r\n<p>* Smart phones</p>\r\n\r\n<p>* Tablets</p>\r\n', 1, '2019-05-27 02:16:49', '2019-05-27 02:16:49'),
(19, 4, 'Does Menorah Exam require plugins such as Flash, Active X or Java?', 'does-menorah-exam-require-plugins-such-as-flash-active-x-or-java-18', '<p>Plugins like Flash, Active X or Java are not necessary to be installed for accessing Menorah Exam. However, if in case your created test contains video or audio files, then it is mandatory for you and your users to update their computer with a plugin</p>\r\n', 1, '2019-05-27 02:17:45', '2019-05-27 02:17:45'),
(20, 4, 'What is an API and how can I use it to integrate my softwares?', 'what-is-an-api-and-how-can-i-use-it-to-integrate-my-softwares-19', '<p>The API (Application Programming Interface) is the set of instructions that will be used to interface the Menorah Exam with third party software and applications. Developers can easily retrieve the up-to-date documentation of the created instructions. For more details you can refer our&nbsp;API document module.</p>\r\n', 1, '2019-05-27 02:18:19', '2019-05-27 02:18:19'),
(21, 4, 'Does Menorah Exam work on an iPhone and/or iPad?', 'does-menorah-exam-work-on-an-iphone-andor-ipad-20', '<p>Yes, Menorah Exam works on all major operating systems, web browsers and devices ensure a streamlined &nbsp;service, that can be accessed hassle-free wherever and whenever you want to.</p>\r\n\r\n<p><br />\r\nMenorah Exam is compatible with all the major operating systems including:</p>\r\n\r\n<p>- Windows</p>\r\n\r\n<p>- Macintosh</p>\r\n\r\n<p>- Linux</p>\r\n\r\n<p>- Chrome OS / Chromebook</p>\r\n\r\n<p>- Smart devices including:</p>\r\n\r\n<p>- iPhone</p>\r\n\r\n<p>- iPod touch</p>\r\n\r\n<p>- iPad</p>\r\n\r\n<p>- Android</p>\r\n', 1, '2019-05-27 02:19:29', '2019-05-27 02:19:29'),
(22, 5, 'How to monetize the created test series?', 'how-to-monetize-the-created-test-series-21', '<p>Menorah Exam allows the facility to sell or earn from the tests (monetize).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The selling feature is only available either with a professional or a business account. You can easily upgrade your account to above two accounts, in order to have the monetization of your created tests.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>A test taker will first pay online via credit/debit card or using a dedicated coupon code, to attempt the required Online exam.</p>\r\n\r\n<p><br />\r\nPayment gateway options; PayPal, PayU money, CC Avenue, Paytm</p>\r\n', 1, '2019-05-27 02:20:56', '2019-05-27 02:20:56'),
(23, 5, 'What are the payment options?', 'what-are-the-payment-options-22', '<p>Online Payments are completed using a highly controlled and secured platform. The featured list of pre-integrated payment options are PayPal, PayU money, CCavenue and Paytm.</p>\r\n\r\n<p>Further the required payment can be processed using a credit card, debit card, net banking along with a coupon or promo code.</p>\r\n\r\n<p>You can &nbsp;simply initiate the payment gateway by adding your credentials in it.</p>\r\n', 1, '2019-05-27 02:21:38', '2019-05-27 02:21:38'),
(24, 5, 'Can I upgrade from Trial to a paid edition?', 'can-i-upgrade-from-trial-to-a-paid-edition-23', '<p>You can easily upgrade from a Free Trial account to a paid account (starter, standard, professional and business). For upgrading your account, you can follow the below mentioned steps;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Option : Dashboard &gt;&gt; Subscription &gt;&gt; Upgrade &gt;&gt; Select the account &gt;&gt; Make Payment</p>\r\n', 1, '2019-05-27 02:22:11', '2019-05-27 02:22:11'),
(25, 5, 'How can I download invoice against the purchase or upgrade of an account?', 'how-can-i-download-invoice-against-the-purchase-or-upgrade-of-an-account-24', '<p>You can download PDF and export to mail a copy of the purchased order. You can follow the below mentioned steps to download a copy of the generated invoice against your payment;</p>\r\n\r\n<p>Go to settings &gt;&gt; Payments &gt;&gt; Action &gt;&gt; Download PDF</p>\r\n', 1, '2019-05-27 02:22:53', '2019-05-27 02:22:53'),
(26, 5, 'What is Menorah Exam’s refund policy?', 'what-is-menorah-exams-refund-policy-25', '<p>No, we do not offer any refund.</p>\r\n\r\n<p>Once you made a payment against a subscribed package (with or without top ups) and later because of any reason you want to discontinue the offered services, Menorah exam will not be able to refund your amount as per our updated payment policy.</p>\r\n', 1, '2019-05-27 02:23:47', '2019-05-27 02:23:47'),
(27, 5, 'Does Menorah Exam stores my card details (credit or debit)?', 'does-menorah-exam-stores-my-card-details-credit-or-debit-26', '<p>Menorah Exam does not store or process any credit card information. All transactions are processed through highly secured payment gateway vendors. You can select a pre-integrated payment gateway from PayPal, PayU, CC Avenue and Paytm.</p>\r\n', 1, '2019-05-27 02:24:18', '2019-05-27 02:24:18'),
(28, 5, 'Explain the different status possible in an online transaction?', 'explain-the-different-status-possible-in-an-online-transaction-27', '<p>The aspirant can counter vivid statuses as discussed below;</p>\r\n\r\n<ol>\r\n <li><em>Initialize</em>\r\n\r\n <ul>\r\n    <li><em>a. Not Started: The transaction has not been started yet.</em></li>\r\n   <li><em>b. Initiated/Initial: The transaction has been started but not completed.</em></li>\r\n </ul>\r\n </li>\r\n <li><em>Refund Status</em>\r\n  <ul>\r\n    <li><em>a. Partially Refunded: A part of paid amount of the transaction has been refunded.</em></li>\r\n    <li><em>b. Refunded: Entire amount of the transaction has been refunded.</em></li>\r\n  </ul>\r\n </li>\r\n <li><em>Failed</em>\r\n <ul>\r\n    <li><em>a. Bounced: &nbsp;Incomplete or no details provided on the payment page.</em></li>\r\n    <li><em>b. Failed: The transaction was not completed due to a failure.</em></li>\r\n    <li><em>c. Under Dispute: A dispute for the transaction has been raised.</em></li>\r\n  </ul>\r\n </li>\r\n <li><em>Successful</em>\r\n <ul>\r\n    <li><em>a. Money with the Wallet: The transaction was successful and the transaction amount is with the wallet money (for eg- PayUMoney)</em></li>\r\n    <li><em>b. Settlement Process: Settlement of the transaction in process.</em></li>\r\n    <li><em>c. Completed: The transaction is settled and completed.</em></li>\r\n </ul>\r\n </li>\r\n</ol>\r\n', 1, '2019-05-27 02:24:48', '2019-05-27 02:24:48'),
(29, 6, 'What happens if I reach the testing limit?', 'what-happens-if-i-reach-the-testing-limit-28', '<p>Once the offered test attempt reaches to 90% of the limit, you will get a notification through mail to upgrade your plan on your registered email id.</p>\r\n', 1, '2019-05-27 02:25:12', '2019-05-27 02:25:12'),
(30, 6, 'How does Menorah Exam back-up and secure my data?', 'how-does-menorah-exam-back-up-and-secure-my-data-29', '<p>Menorah Exam has an incremental backup of all data. Our website is hosted &nbsp;24/7 by highly secured, encrypted Amazon data servers at various international locations to ensure the highest level of security for your data. Our 256-bit encryption provides security to all the passwords when stored on our system. Think Exam does not process/ record/ store your payment details, like credit card numbers. &nbsp;The transactions are performed using secured third party payment gateway vendors that are PayPal, CC Avenue, PayU, Paytm.</p>\r\n', 1, '2019-05-27 02:25:46', '2019-05-27 02:25:46'),
(31, 6, 'I have subscribed to a paid plan in the past. What happens if I don’t renew it?', 'i-have-subscribed-to-a-paid-plan-in-the-past-what-happens-if-i-dont-renew-it-30', '<p>Once, you miss the expiry date for renewal of your account. Our sales associate will get in touch with you over the call or on the email, to keep you informed and updated that how to renew the services and avoid termination of the account.</p>\r\n', 1, '2019-05-27 02:26:22', '2019-05-27 02:26:22');
INSERT INTO `feedbacks` (`id`, `title`, `slug`, `user_id`, `subject`, `description`, `read_status`, `created_at`, `updated_at`) VALUES
(1, 'SBI PO 2017', 'lms-feedback', 7, 'LMS ', 'If you really want to crack any exam by enjoying your preparation then Menorah OES is the right choice. Tests are at par with the actual exam, plus the quality of questions, performance analysis', 1, '2018-04-03 10:55:15', '2019-06-04 09:11:34'),
(2, 'SSC JE 2016', 'ssc-je-2016-1', 7, 'SSC', 'I had attempted both, sectional as well as full length tests of Menorah OES. Test analysis aided me in self-evaluation, which was essential for me as I was preparing on my own. The tests also enhanced', 1, '2019-05-22 04:35:19', '2019-06-04 09:11:44'),
(6, 'TEST', 'test-5', 7, 'test', 'OES was the only one I had purchased.The series improved my speed to a great extent,  helped me in identifying my mistakes which I improved through the section-wise practice questions provided by OES.', 1, '2019-05-22 05:36:42', '2019-06-04 09:11:39'),
(7, 'Best Support', 'best-support-3', 19, 'Best Support', 'Best Support... Very prompt in answering and assisting all queries. Always extends support whenever required. Hope to receive continuous support in this manner..\r\n\r\n', 1, '2019-06-10 11:46:22', '2019-06-10 11:53:23'),
(8, 'Customer Support', 'customer-support-4', 17, 'Customer Support', 'Good Customer Support, Nice Script, Value for Money. Good Work.... Keep the same Sprit...... A Great thanks to you guys..... \r\nHope to see some other best scripts from you guys..', 1, '2019-06-10 11:47:07', '2019-06-10 11:53:14'),
(9, 'Feature Availability', 'feature-availability-5', 17, 'Feature Availability', 'I have purchased this Application 2 times, I like service and tech support person is very friendly, there were some bugs but Menorah\'s team solved it.\r\nThank you!!', 1, '2019-06-10 11:48:03', '2019-06-10 11:53:09'),
(10, 'Code Quality', 'code-quality-6', 20, 'Code Quality', 'I spent a lot of time for looking a product. But this product meets my requirement. Very dynamic and professional. The small bugs will be solved soon, every product has such. ', 1, '2019-06-10 11:48:55', '2019-06-10 11:53:02'),
(12, 'Code Quality', 'code-quality-7', 20, 'Code Quality', 'Digi Samaritan are the best in terms of support. they help solve all my worries and made sure i was ok. really happy\r\n\r\n', 1, '2019-06-10 11:52:12', '2019-06-10 11:52:57'),
(13, 'Best Onlineexam System', 'best-onlineexam-system-8', 10, 'Best Onlineexam System', 'I had attempted both, sectional as well as full length tests of OES. Test analysis aided me in self-evaluation, which was essential for me as I was preparing on my own. ', 1, '2019-06-12 05:56:34', '2019-06-12 05:57:25');
INSERT INTO `instructions` (`id`, `title`, `slug`, `content`, `created_at`, `updated_at`) VALUES
(1, 'General Instructions', 'general-instructions', '<p><strong>Please read these instructions carefully.</strong> A&nbsp;candidate who breaches any of the Examination Regulations will be liable to disciplinary action including (but not limited to) suspension or expulsion from the University.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Timings</strong></p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Examinations will be conducted during the allocated times shown in the examination timetable.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The examination hall will be open for admission <strong>10 minutes </strong>before the time scheduled for the commencement of the examination. You are to find your allocated seat but&nbsp;do<strong>&nbsp;NOT </strong>turn over the question paper until instructed at the time of commencement of the examination.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You will not be admitted for the examination after <strong>one hour</strong> of the commencement of the examination.</p>\r\n\r\n<p><strong>Personal Belongings</strong></p>\r\n\r\n<ul>\r\n <li>All your personal belongings (such as bags, pouches, ear/headphones, laptops etc.) must be placed at the designated area outside the examination hall. Please do not bring any valuable belongings except the essential materials required for the examinations.&nbsp;\r\n  <ul>\r\n    <li>Any unauthorised materials, such as books, paper, documents, pictures and electronic devices with communication and/or storage capabilities such as tablet PC, laptop, smart watch, portable audio/video/gaming devices etc. are not to be brought into the examination hall.</li>\r\n  </ul>\r\n </li>\r\n</ul>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>Handphones brought into the examination hall must be switched off at ALL times.</strong> If your handphone is found to be switched on in the examination hall, the handphone will be confiscated and retained for investigation of possible violation of regulations.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Photography is&nbsp;<strong>NOT</strong> allowed in the examination hall at&nbsp;<strong>ALL </strong>times.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; All materials and/or devices which are found in violation of any examination regulations will be confiscated.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The University will not be responsible for the loss or damage of any belongings in or outside the examination hall.</p>\r\n\r\n<p><strong>At the Start of the Examination</strong></p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>Do&nbsp;NOT </strong>turn over the question paper placed on your desk until instructed to do so at the time of commencement of the examination.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Please place your identification documents (such as matric card, identity card, passport, driving licence or EZ-Link concession card) at the top right corner of your examination desk for the marking of attendance and verification of identity during the examination.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Please check that you have the correct question paper and read the instructions printed on your examination question paper carefully.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; All examinations are anonymous. Therefore, do not write your name on the answer book. You should write only your matriculation number, correctly and legibly, in the space provided on the cover of each answer book. Providing incorrect/illegible matriculation number could risk your answer book being considered void.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p><strong>During Examination</strong></p>\r\n\r\n<ul>\r\n <li>You are not allowed to communicate by word of mouth or otherwise with other candidates (this includes the time when answer scripts are being collected).</li>\r\n <li>Please raise your hand if you wish to communicate with an invigilator.</li>\r\n</ul>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Unless granted permission by an invigilator, you are not allowed to leave your seat.</p>\r\n\r\n<ul>\r\n  <li>Once you have entered the examination hall, you will not be allowed to leave the hall&nbsp;until<strong> one hour</strong><br />\r\n  &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; after the examination has commenced.&nbsp;</li>\r\n  <li>If, for any reason, you are given permission to leave the hall temporarily, you must be accompanied<br />\r\n &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;by an invigilator throughout your absence from the examination hall. <strong>You are required to leave<br />\r\n &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; your&nbsp;</strong><strong>handphone on your desk when you leave the hall temporarily.</strong></li>\r\n</ul>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; All answers, with the exception of graphs, sketches, diagrams, etc. should be written in black or blue pen, unless otherwise specified. Answers written in pencil will not be marked. The blank pages in the answer book are to be used only for candidates&#39; rough work. Solutions or any other materials written on these blank pages will not be marked.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Do not write on, mark, highlight or deface any reference materials provided for the examination. If found doing so, the reference materials will be removed from your use for the rest of the examination and you will be made to pay for the cost of the materials that have to be replaced.</p>\r\n\r\n<p><strong>At the End of the Examination</strong></p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You are&nbsp;<strong>NOT</strong> allowed to leave the examination hall during the last <strong>15 minutes</strong> of the examination and during the collection of the answer scripts. All candidates must remain seated throughout this period for invigilators to properly account for all answer scripts to be collected.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Do <strong>NOT </strong>continue to write after the examination has ended. You are to <strong>remain seated quietly</strong>&nbsp;while your answer scripts are being collected and counted.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; No papers, used or unused, may be removed from the examination hall. You may take your own question paper with you unless otherwise instructed.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You are to stay in the examination hall until the Chief Invigilator has given the permission to leave. Do <strong>NOT</strong> talk until you are outside of the examination hall.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You are responsible to ensure that your answer scripts are submitted at the end of the examination. If you are present for the examination and do not submit your answer script, you will be deemed to have sat for and failed the examination concerned. Any unauthorised removal of answer script or part of answer script from the examination hall would deem the answer script as null and void.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Once dismissed, you should leave the examination hall quickly and quietly.&nbsp;Remember to take your personal belongings with you.&nbsp;</p>\r\n', '2016-11-14 10:18:35', '2016-11-14 10:18:35');
