INSERT INTO `pages` (`id`, `name`, `slug`, `content`, `status`, `created_at`, `updated_at`) VALUES
(1, 'Why us?', 'why-us', '<p>We offer authentic test questions and easy learning material to ensure success by building your fundamentals. We use technology to enhance learning by actively engaging you. Our dynamic tests optimise your learning for the time invested.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Exemplary preparation strategies and exam techniques identified by exam toppers</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Proven tips &amp; tricks based on in-depth research and analysis by subject experts</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Career guidance by successful professionals</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Exam focused, comprehensive but concise study material</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>24x7 learning material using text, audio and videos</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Precise communication in simple and vernacular language</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Exclusive &lsquo;question reservoir&rsquo; for perfect and complete practice</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Video lessons for difficult &amp; tricky questions</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Mind stimulating &lsquo;adaptive practice&rsquo; with difficulty level of questions adjusting as per performance</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Performance accelerating analytics offered topic and section wise</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 1, '2019-05-24 04:00:30', '2019-06-10 11:58:04'),
(2, 'Our Mission', 'our-mission-1', '<p>Menorah OES provides brilliant solutions and best online learning experience for preparation of competitive exams. We aim to customise learning for millions of students to enhance their career and success.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>WHY CHOOSE OES GRADE A 2019 ONLINE COURSE</h2>\r\n\r\n<ul>\r\n  <li>In spite of the syllabus being exhaustive, we have devised strategy and prepared such a course structure which enables the student to not only clear but excel in the OES Grade A exam.</li>\r\n  <li>The video lessons are self-explanatory and available for the students to access them and prepare during the time most feasible for them.</li>\r\n <li>We provide notes which contain very crisp, specific and relevant data from exam point of view.</li>\r\n <li>We believe in smart and focussed study and thus prepare the schedule which enables a student to cover the entire course within the given time frame.</li>\r\n <li>The various tests in form of concept questions, chapter tests, section tests and mock tests provide a wide and targeted coverage of the syllabus. Practice through these various tests help our students to continually revise the topics and be prepared for the upcoming examination.</li>\r\n  <li>Live classes by the expert faculty helps in doubt clarification and up-to-date and exam-relevant topic discussions.</li>\r\n</ul>\r\n', 1, '2019-05-24 04:04:17', '2019-06-10 11:59:13');
