(2, 2, 2, '', 'c612bf1478092ccc76b779104e84c88340541c67-1', 'radio', '<p>The nucleus of an atom consists of</p>\r\n', '', 0, 2, '[{\"option_value\":\"electrons and neutrons\",\"optionl2_value\":\"\\u092c\\u093f\\u0928\\u094d\\u0926\\u0941\\u0938\\u093e\\u0930\",\"has_file\":0,\"file_name\":\"\"},{\"option_value\":\"electrons and protons\",\"optionl2_value\":\"\\u0905\\u0936\\u094b\\u0915\",\"has_file\":0,\"file_name\":\"\"}]', 1, '1', 2, 30, 'easy', 'no hint', '<p>no Explanatio</p>\r\n', NULL, 1, '2018-04-03 09:45:51', '2018-04-03 09:50:18', '<p>वह शासक जिसने एक सच्चे जैन मुनि की तरह उपवास के द्वार शरीर त्याग दिया कौन था ?</p>\r\n', '<p>वह शासक जिसने एक सच्चे जैन मुनि की तरह उपवास के द्वार शरीर त्याग दिया कौन था ?</p>\r\n', NULL),
