(4, 2, 2, '', '4202db71d02b8c3858e9c089bb0399cad753739f-3', 'radio', '<p>The most electronegative element among the following is</p>\r\n', '', 0, 2, '[{\"option_value\":\"sodium\",\"optionl2_value\":\"\\u092e\\u0941\\u0930\\u094d\\u0936\\u093f\\u0926 \\u0915\\u0941\\u0932\\u0940 \\u0916\\u093e\\u0901\",\"has_file\":0,\"file_name\":\"\"},{\"option_value\":\"bromine\",\"optionl2_value\":\"\\u0938\\u0906\\u0926\\u0924 \\u0916\\u093e\\u0901\",\"has_file\":0,\"file_name\":\"\"}]', 1, '1', 2, 30, 'easy', 'no hint', '<p>no Explanatio</p>\r\n', NULL, 1, '2018-04-03 09:45:51', '2018-04-03 09:52:02', '<p>बंगाल को मुगल साम्राज्य से पृथक् कर स्वतन्त्र किया ?</p>\r\n\r\n<ul>\r\n</ul>\r\n', '<p>बंगाल को मुगल साम्राज्य से पृथक् कर स्वतन्त्र किया ?</p>\r\n\r\n<ul>\r\n</ul>\r\n', NULL),
