(6, 2, 2, '', '94626897f6e3f6a11eed285f806426914b85e025-5', 'radio', '<p>The metallurgical process in which a metal is obtained in a fused state is called</p>\r\n', '', 0, 2, '[{\"option_value\":\"smelting\",\"optionl2_value\":\" 1877 \\u0908. \\u092e\\u0947\\u0902 \\u092c\\u093e\\u0926\",\"has_file\":0,\"file_name\":\"\"},{\"option_value\":\"roasting\",\"optionl2_value\":\"1833 \\u0908. \\u092e\\u0947\\u0902 \\u092c\\u093e\\u0926\",\"has_file\":0,\"file_name\":\"\"}]', 1, '1', 2, 30, 'easy', 'no hint', '<p>no Explanatio</p>\r\n', NULL, 1, '2018-04-03 09:45:51', '2018-04-03 09:54:01', '<p>अंग्रेजों ने &#39;फूट डालो और शासन करो&#39; की नीति कब अपनाई ?</p>\r\n', '<p>अंग्रेजों ने &#39;फूट डालो और शासन करो&#39; की नीति कब अपनाई ?</p>\r\n', NULL),
