(123, 7, 9, '', '5b310f818d74f3916872ad98db5a286c94eb73d5-122', 'radio', '<h2>&nbsp;</h2>\r\n\r\n<p>Three partners shared the profit in a business in the ratio 5 : 7 : 8. They had partnered for 14 months, 8 months and 7 months respectively. What was the ratio of their investments?</p>\r\n', '', 0, 2, '[{\"option_value\":\" 5 : 7 : 8      \",\"optionl2_value\":\"\\u092c\\u091b\\u0947\\u095c\\u093e\",\"has_file\":0,\"file_name\":\"\"},{\"option_value\":\" 20 : 49 : 64      \",\"optionl2_value\":\"\\u092a\\u093f\\u0932\\u094d\\u0932\\u093e\",\"has_file\":0,\"file_name\":\"\"}]', 1, '1', 2, 20, 'easy', 'No Hint', '<p>No Explanation</p>\r\n', NULL, 1, '2018-04-04 09:08:17', '2018-04-04 09:08:17', '<p>जैसे किसी गाय के लिए बछड़ा है, वैसे ही किसी बकरी के लिए है ?</p>\r\n', '<p>जैसे किसी गाय के लिए बछड़ा है, वैसे ही किसी बकरी के लिए है ?</p>\r\n', NULL),
(124, 7, 9, '', '21cdb6777ea297c83ad006789199157ffb17b4f6-123', 'radio', '<p>Three partners A, B, C start a business. B&#39;s Capital is four times C&#39;s capital and twice A&#39;s capital is equal to thrice B&#39;s capital. If the total profit is Rs 16500 at the end of a year, Find out B&#39;s share in it.</p>\r\n', '', 0, 2, '[{\"option_value\":\" 6000\",\"optionl2_value\":\"\\u0906\\u0915\\u093e\\u0936\",\"has_file\":0,\"file_name\":\"\"},{\"option_value\":\"5000\",\"optionl2_value\":\"\\u0935\\u093e\\u092f\\u0941\",\"has_file\":0,\"file_name\":\"\"}]', 1, '1', 2, 20, 'easy', 'No Hint', '<p>No Explanation</p>\r\n', NULL, 1, '2018-04-04 09:10:21', '2018-04-04 09:10:21', '<p>&#39;मछली&#39; जैसे जल से सम्बन्धित है, वैसे ही &#39;चिड़िया&#39; किससे सम्बन्धित है ?</p>\r\n', '<p>&#39;मछली&#39; जैसे जल से सम्बन्धित है, वैसे ही &#39;चिड़िया&#39; किससे सम्बन्धित है ?</p>\r\n', NULL),
(125, 7, 9, '', 'cc17b3f5dfb1090bbb81dcec3502a6cb2861b48f-124', 'radio', '<p>Kamal started a business investing Rs 9000. After five months, Sameer joined with a capital of Rs 8000. If at the end of the year, they earn a profit of Rs. 6970, then what will be the share of Sameer in the profit?</p>\r\n', '', 0, 2, '[{\"option_value\":\" Rs 2380\",\"optionl2_value\":\"\\u0906\\u0915\\u093e\\u0936\",\"has_file\":0,\"file_name\":\"\"},{\"option_value\":\"Rs 2300\",\"optionl2_value\":\"\\u0935\\u093e\\u092f\\u0941\",\"has_file\":0,\"file_name\":\"\"}]', 1, '1', 2, 20, 'easy', 'No hint', '<p>No Explanation</p>\r\n', NULL, 1, '2018-04-04 10:24:20', '2018-04-04 10:24:20', '<p>&#39;जहाज&#39; जैसे &#39;कप्तान&#39; से सम्बन्धित है, वैसे ही &#39;अखबार&#39; किससे सम्बन्धित है ?</p>\r\n', '<p>&#39;जहाज&#39; जैसे &#39;कप्तान&#39; से सम्बन्धित है, वैसे ही &#39;अखबार&#39; किससे सम्बन्धित है ?</p>\r\n', NULL),
(126, 7, 9, '', '5a39da88aa129518b4f0860a440a06bfbee8cd0d-125', 'checkbox', '<p>P and Q invested in a business. The profit earned was divided in the ratio 2 : 3. If P invested Rs 40000, the amount invested by Q is</p>\r\n', '', 0, 3, '[{\"option_value\":\"Rs. 40000\",\"optionl2_value\":\"\\u092c\\u091c\\u093e\\u091c\",\"has_file\":0,\"file_name\":\"\"},{\"option_value\":\"Rs. 50000\",\"optionl2_value\":\" \\u0915\\u092e\\u0940\\u091c\",\"has_file\":0,\"file_name\":\"\"},{\"option_value\":\"Rs. 60000\",\"optionl2_value\":\"\\u0927\\u093e\\u0917\\u093e\",\"has_file\":0,\"file_name\":\"\"}]', 2, '[{\"answer\":\"1\"},{\"answer\":\"3\"}]', 2, 20, 'easy', 'No Hint', '<p>No&nbsp;Explanation</p>\r\n', NULL, 1, '2018-04-04 10:26:37', '2018-04-04 10:26:37', '<p>मोची : चमड़ा : : दर्जी : ?</p>\r\n', '<p>मोची : चमड़ा : : दर्जी : ?</p>\r\n', NULL),
