(128, 7, 9, '', '61c767ff4e251fda4fa6fa3abf8a968881750290-127', 'checkbox', '<p>A, B, C rent a pasture. A puts 10 oxen for 7 months, B puts 12 oxen for 5 months and C puts 15 oxen for 3 months for grazing. If the rent of the pasture is Rs. 175, how much must C pay as his share of rent?</p>\r\n', '', 0, 3, '[{\"option_value\":\" Rs. 45\",\"optionl2_value\":\"\\u0935\\u0930\\u094d\\u0917 \\u092b\\u0940\\u091f \",\"has_file\":0,\"file_name\":\"\"},{\"option_value\":\" Rs. 50\",\"optionl2_value\":\"\\u0935\\u0930\\u094d\\u0917\\u092e\\u0942\\u0932\",\"has_file\":0,\"file_name\":\"\"},{\"option_value\":\"Rs. 55\",\"optionl2_value\":\" \\u0935\\u0930\\u094d\\u0917 \\u0907\\u0902\\u091a \",\"has_file\":0,\"file_name\":\"\"}]', 2, '[{\"answer\":\"1\"},{\"answer\":\"3\"}]', 2, 20, 'easy', 'NO Hint', '', NULL, 1, '2018-04-04 10:39:49', '2018-04-04 10:39:49', '<p>निम्नलिखित शब्दों में से विषम शब्द चुनिए ?</p>\r\n', '<p>निम्नलिखित शब्दों में से विषम शब्द चुनिए ?</p>\r\n', NULL),
(129, 7, 9, '', 'a917ca37643c6536e3dff7e8f7575ea9ae524540-128', 'checkbox', '<p>In a business, A and C invested amounts in the ratio 2 : 1 , whereas the ratio between amounts invested by A and B was 3 : 2 . If Rs 157300 was their profit, how much amount did B receive?</p>\r\n', '', 0, 3, '[{\"option_value\":\"Rs. 48000\",\"optionl2_value\":\"\\u0928\\u093e\\u0915\",\"has_file\":0,\"file_name\":\"\"},{\"option_value\":\"Rs. 48200\",\"optionl2_value\":\" \\u0939\\u094b\\u0902\\u0920\",\"has_file\":0,\"file_name\":\"\"},{\"option_value\":\"Rs. 48400\",\"optionl2_value\":\"\\u0917\\u0932\\u093e\",\"has_file\":0,\"file_name\":\"\"}]', 2, '[{\"answer\":\"1\"},{\"answer\":\"3\"}]', 2, 20, 'easy', '', '', NULL, 1, '2018-04-04 10:41:44', '2018-04-04 10:41:44', '<p>निम्नलिखित शब्दों में से विषम शब्द चुनिए ?</p>\r\n', '<p>निम्नलिखित शब्दों में से विषम शब्द चुनिए ?</p>\r\n', NULL),
(130, 7, 9, '', '4b2ca84f8a606eeb041fe820914f07fa50d0de47-129', 'radio', '<p>A and B started a business in partnership investing Rs. 20,000 and Rs. 15,000 respectively. After six months, C joined them with Rs. 20,000. What will be B&#39;s share in total profit of Rs. 25,000 earned at the end of 2 years from the starting of the business?</p>\r\n', '', 0, 2, '[{\"option_value\":\"Rs. 7500 \",\"optionl2_value\":\"\\u092e\\u0939\\u093e\\u0938\\u093e\\u0917\\u0930\",\"has_file\":0,\"file_name\":\"\"},{\"option_value\":\"Rs. 9000\",\"optionl2_value\":\"\\u0915\\u0941\\u0906\\u0901\",\"has_file\":0,\"file_name\":\"\"}]', 1, '1', 2, 20, 'easy', '', '', NULL, 1, '2018-04-04 10:43:11', '2018-04-04 10:43:26', '<p>निम्नलिखित शब्दों में से विषम शब्द चुनिए ?</p>\r\n', '<p>निम्नलिखित शब्दों में से विषम शब्द चुनिए ?</p>\r\n', NULL),
(131, 7, 9, '', '643597e7b685107ee7ccde85bb82eb1cf43a0615-130', 'radio', '<p>P, Q, R enter into a partnership. P initially invests 25 lakh &amp; adds another 10 lakhs after one year. Q initially invests 35 lakh &amp; withdrawal 10 lakh after 2 years and R invests Rs 30 Lakhs . In what ratio should the profit be divided at the end of 3 years?</p>\r\n', '', 0, 2, '[{\"option_value\":\"18:19:19\",\"optionl2_value\":\"\\u0927\\u094b\\u0916\\u093e\",\"has_file\":0,\"file_name\":\"\"},{\"option_value\":\" 18:18:19\",\"optionl2_value\":\"\\u0938\\u093e\\u0939\\u093f\\u0924\\u094d\\u092f\\u093f\\u0915\",\"has_file\":0,\"file_name\":\"\"}]', 1, '1', 2, 20, 'easy', '', '', NULL, 1, '2018-04-04 10:45:04', '2018-04-04 10:45:04', '<p>धन : दुरूपयोग : : लेखन : ?</p>\r\n', '<p>धन : दुरूपयोग : : लेखन : ?</p>\r\n', NULL),
(132, 7, 9, '', 'c8570e1fa79af4d6e3c3f686fdf3f87304e74b21-131', 'match', '<p>A, B, C subscribe Rs. 50,000 for a business. A subscribes Rs. 4000 more than B and B Rs. 5000 more than C. Out of a total profit of Rs. 35,000, A receives</p>\r\n', '', 0, 3, '{\"left\":{\"title\":\"List II\",\"titlel2\":\"\\u0932\\u093f\\u0938\\u094d\\u091f\\u094d I\",\"options\":[\"Rs. 8400 \",\"Rs. 11,900\",\"Rs. 13,600 \"],\"optionsl2\":[\" \\u0938\\u094d\\u0935\\u093e\\u0930\\u094d\\u0925\\u0940\",\"\\u0928\\u093f\\u0915\\u0943\\u0937\\u094d\\u091f\",\"\\u0909\\u0926\\u093e\\u0938\"]},\"right\":{\"title\":\"List II\",\"titlel2\":\"\\u0932\\u093f\\u0938\\u094d\\u091f\\u094d II\",\"options\":[\"18:19:19\",\"19:19:18\",\"18:18:19\"],\"optionsl2\":[\"\\u0928\\u0917\\u0923\\u094d\\u092f\",\" \\u092c\\u0947\\u0915\\u0930\",\"\\u0916\\u0930\\u0940\\u0926\\u093e\\u0930\"]}}', 3, '[{\"answer\":\"1\"},{\"answer\":\"2\"},{\"answer\":\"3\"}]', 2, 30, 'easy', '', '', NULL, 1, '2018-04-04 10:51:27', '2018-04-04 10:51:27', '<p>आशावादी : प्रसन्न : : निराशावादी : ? <strong> </strong></p>\r\n', '<p>आशावादी : प्रसन्न : : निराशावादी : ?</p>\r\n', NULL),
